import mongoose , {Schema} from 'mongoose';
import uniqueValidator from 'mongoose-unique-validator';
import Branch from './Branch.model';
import Patient from './Patient.model';
import Pricing from './Pricing.model';

const branch = new Branch().getInstance().schema ;
const patient = new Patient().getInstance().schema 
const pricing = new Pricing().getInstance().schema 

class Company {
    initSchema(){
        const schema = new Schema({
            name:{
                type:String,
                required:true
            },
            timestamp:{
                type:String,
                required:true
            },
            phone:{
                type:String,
                required:true
            },
            // ,
            branches:[branch],
            patient:[patient],
            pricing:[pricing]

        })
        schema.plugin(uniqueValidator);
        mongoose.model("company", schema);
    }

    getInstance(){
        this.initSchema();
        return mongoose.model("company");
    }
}

export default Company ;

